(4, 63, ' The Philippine Transparency Seal', 'transparency-seal', '<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;"> </p>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;"> </p>\r\n<p><img style="font-family: Verdana; font-size: 11px; line-height: 18px;" src="http://namria.gov.ph/Images/transparency_seal.png" alt="" width="152" height="151" align="left" hspace="5" vspace="5" /></p>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;">A pearl buried inside a tightly-shut shell is practically worthless. Government information is a pearl, meant to be shared with the public in order to maximize its inherent value.</p>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;">The Transparency Seal, depicted by a pearl shining out of an open shell, is a symbol of a policy shift towards openness in access to government information. On the one hand, it hopes to inspire Filipinos in the civil service to be more open to citizen engagement; on the other, to invite the Filipino citizenry to exercise their right to participate in governance.</p>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;">This initiative is envisioned as a step in the right direction towards solidifying the position of the Philippines as the Pearl of the Orient – a shining example for democratic virtue in the region.</p>\r\n<table style="font-family: Verdana; font-size: 11px; line-height: normal; width: 435px;" border="0">\r\n<tbody>\r\n<tr>\r\n<td height="30px">I.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#mandate">MANDATE, FUNCTIONS AND OFFICIALS</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">II.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#annual">ANNUAL REPORTS FOR THE LAST 3 YEARS</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">III.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#approved">APPROVED BUDGET AND CORRESPONDING TARGETS</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">IV.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#major">PROGRAMS AND PROJECTS - KEY RESULT AREAS</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">V.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#program">PROGRAM/PROJECT BENEFICIARIES</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">VI.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#status">STATUS OF IMPLEMENTATION AND PROGRAM/PROJECT REPORTS</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">VII.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#procurement">ANNUAL PROCUREMENT PLAN AND CONTRACTS AWARDED</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">VIII.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#contracts">CONTRACTS AWARDED</a></div>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td height="30px">IX.</td>\r\n<td>\r\n<div align="left"><a style="color: #0066cc;" href="http://namria.gov.ph/transparencySeal.aspx#compliance">CERTIFICATE OF COMPLIANCE</a></div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><br style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;" /><br style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;" /><br style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;" /></p>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;">NAMRIA Compliance with Sec. 93 (Transparency Seal) R.A. No. 10155 <br />(General Appropriations Act FY 2012)</p>\r\n<p> </p>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="mandate"></a>I. Mandate, Functions and Officials</p>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;">The agency''s mandate and functions, names of its officials with their position and designation and contact information.</p>\r\n<ul style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;">\r\n<ul>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/missionvision.pdf">Mandate, Mission and Vision</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://www.namria.gov.ph/about.aspx#functions">Core Functions</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/orgChartHiRes1.pdf">Organizational Structure</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/directory.aspx">Directory</a></li>\r\n</ul>\r\n</ul>\r\n<p> </p>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="annual"></a>II. Annual Reports</p>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;">Annual Reports, as required under National Budget Circular Nos. 507 and 507- Dated January 31, 2010 and June 12, 2007, respectively.</p>\r\n<ul style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;"><ol>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><strong>Statement of Allotment, Obligation and Balances</strong> <br />1.0 FY 2014<br />1.1 <a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/saob/saob2013.pdf">FY 2013</a><br /><ol><ol>1.1.1</ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/saob/saob2013novA.pdf"> as of November ANNEX A</a><br /><ol><ol>1.1.2</ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/saob/saob2013novA1.pdf"> as of November ANNEX A1</a><br /><ol><ol>1.1.3</ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/saob/saob2013_junsaro.pdf"> List of ABM/SAROs/Sub-Allotment Release Orders </a><br /><ol><ol>        (as of 30 June 2013) </ol></ol><br /><ol><ol>1.1.4</ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/saob/saob2013_jundbal.pdf"> Statement of Appropriations, Allotments, Obligations,         Disbursementsand Balances (as of 30 June 2013)</a>1.2 <a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/saob/saob2012.pdf">FY 2012</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><strong>Disbursement and Income</strong> <br />2.1 Disbursement Report<ol><ol>2.1.0</ol></ol><a style="color: #0066cc;"> FY 2014</a><br /><ol><ol>2.1.1</ol></ol><a style="color: #0066cc;"> FY 2013</a><ol><ol><ol>2.1.2.1</ol></ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/dr/dr2013novAc.pdf"> as of November ANNEX C</a><br /><ol><ol><ol>2.1.3.2</ol></ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/dr/dr2013novAd.pdf"> as of November ANNEX D</a><br /><ol><ol><ol>2.1.4.1</ol></ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/dr/dr2013jun_dscoub.pdf"> Detailed Statement of Current Year''s Obligations, <br />           Unpaid Obligations(as of 30 June 2013) </a><br /><ol><ol><ol>2.1.4.2</ol></ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/dr/dr2013jun_spoupo.pdf"> Summary of Prior Year''s Obligations and <br />           Unpaid Prior Year''s Obligations(as of 30 June 2013)</a><br /><ol><ol><ol>2.1.4.2</ol></ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/dr/dr2013jun_srd.pdf"> Summary Report of Disbursements (as of 30 June 2013) </a><br /><ol><ol>2.1.2</ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/dr/dr2012.pdf"> FY 2012</a>2.2 Income Report<ol><ol>2.2.0 FY 2014</ol></ol><br /><ol><ol>2.2.1</ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/ir/ir2013.pdf"> FY 2013</a><br /><ol><ol>2.2.2</ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/ir/ir2012.pdf"> FY 2012</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><strong>Physical Plan</strong> <br />3.1 <a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/pp/pp2014.pdf">FY 2014</a><br />3.2 <a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/pp/pp2013.pdf">FY 2013</a><br />3.3 <a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/pp/pp2012.pdf">FY 2012</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><strong>Financial Report of Operation</strong><br />4.0 FY 2014 <br />4.1 <a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fro/fro2013.pdf">FY 2013 </a><br />List of Agency Budget Matrix/Special Allotment Release <br />orders/Sub allotment Release Orders (Please refer to item 1.1.2 ANNEX A1)<br />4.2 <a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fro/fro2012.pdf">FY 2012</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><strong>Financial Accountability Reports</strong><br />5.1 FY 2014<br />5.2 FY 2013<br /><ol><ol>5.2.1 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fr/far_fpr_nov2013.pdf">Financial Performance Report (as of 15 November 2013) </a><br /><ol><ol>5.2.2 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fr/far_soancab_nov2013.pdf">Summary of Allotment and NCA Balance <br />        (as of 15 November 2013) </a><br /><ol><ol>5.2.3 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fr/far_su_nov2013.pdf">Summary of Utilization (as of 15 November 2013) </a><br /><ol><ol>5.2.4 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fr/far_sobal_nov2013.pdf">Summary of balance (as of 15 November 2013) </a><br /><ol><ol>5.2.5 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fr/far_saob_nov2013.pdf">Statement of allotments, Obligation and Balance <br />        (as of 15 November 2013) </a><br /><ol><ol>5.2.6 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/fr/far_rod_nov2013.pdf">Summary Report of Disbursements (as of 15 November 2013) </a></li>\r\n</ol></ul>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;"> </p>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="approved"></a>III. Approved budgets and corresponding targets</p>\r\n<ul style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;"><ol>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/gaa/gaa2014.pdf">FY 2014</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/gaa/gaa2013.pdf">FY 2013</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/gaa/gaa2012.pdf">FY 2012</a></li>\r\n</ol></ul>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;">           4. FY 2011</p>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="major"></a>IV. Program and Projects - Key Result Areas</p>\r\n<blockquote style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;">\r\n<p style="padding: 0px 20px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/kra/kra2012.pdf">Major programs and projects categorized in accordance with the five key result areas under E.O. 43, s. 2011</a></p>\r\n</blockquote>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;"> </p>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="program"></a>V. Program/Projects Beneficiaries</p>\r\n<blockquote style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;">\r\n<p style="padding: 0px 20px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/tarben/2014beneficiaries.pdf">2014 NAMRIA''s Targets Project beneficiaries</a></p>\r\n<p style="padding: 0px 20px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/2013beneficiaries.pdf">2013 NAMRIA''s Targets Project beneficiaries</a></p>\r\n<p style="padding: 0px 20px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/2012beneficiaries.pdf">2012 NAMRIA''s Program or Project beneficiaries</a></p>\r\n</blockquote>\r\n<p style="padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;"> </p>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="status"></a>VI. Status of Project/Program Implementation</p>\r\n<ul style="font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;"><ol>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;">FY 2014<br /><ol><ol>1.0 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/ppr/ppr_jan2014.pdf">January </a><br /><ol><ol>1.1 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/ppr/ppr_feb2014.pdf">February </a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/ppr/2013ppr.zip">FY 2013</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/pir/pir2012.pdf">FY 2012</a></li>\r\n</ol></ul>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="procurement"></a>VII. Annual Procurement Plan</p>\r\n<ul class="style1" style="color: #ffffff; font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;"><ol class="style2" style="color: #000000;">\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;">FY 2014</li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/app/app2013.pdf">FY 2013</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/app/app2012.pdf">FY 2012</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/app/app2011.pdf">FY 2011</a></li>\r\n</ol></ul>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="contracts"></a>VIII. Contracts Awarded</p>\r\n<ul class="style1" style="color: #ffffff; font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;"><ol class="style2" style="color: #000000;">\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;">FY 2014</li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/soac/soac2013Nov.pdf">FY 2013</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/soac/soac2012.pdf">FY 2012</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/soac/soac2011.pdf">FY 2011</a></li>\r\n</ol></ul>\r\n<p class="sectionHeader" style="padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;"><a name="compliance"></a>IX. Certificate of Compliance</p>\r\n<ul class="style1" style="color: #ffffff; font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;"><ol class="style2" style="color: #000000;">\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;">FY 2013</a><br /><ol><ol>1.1 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/coc/coc_saln2013.pdf">Statement of Assets, Liabilities, and Networth (SALN)</a><br /><ol><ol>1.2 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/coc/coc_philgepsdec2013.pdf">PhilGEPS Posting</a><br /><ol><ol>1.3 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/coc/coc_trans2013.pdf">Transparency Seal Provision of the General Appropriation Act of 2013</a><br /><ol><ol>1.4 </ol></ol><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/coc/coc_ARTA.pdf">Anti-Red Tape Act</a></li>\r\n<li style="padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;"><a style="color: #0066cc;" href="http://namria.gov.ph/Downloads/Transparency/coc/coc2012.pdf">FY 2012</a></li>\r\n</ol></ul>', '', 1, 10, '2014-07-21 07:47:45', 817, '', '2014-07-31 07:20:40', 817, 0, '0000-00-00 00:00:00', '2014-07-22 01:13:36', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"0","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 0, '', '', 1, 74, '', 0, '*', ''),
