(19, 108, 'MGB survey teams conduct GNSS observation of core and buffer zones in Misamis Occidental', 'mgb-survey-teams-conduct-gnss-observation-of-core-and-buffer-zones-in-misamis-occidental', '<p>&nbsp;</p>\r\n<div style="text-align: justify;">&nbsp; &nbsp; &nbsp; Survey teams from the Geodetic Division of the Mapping&nbsp;and Geodesy Branch (MGB) conducted Global Navigation Satellite&nbsp;System (GNSS) observation to delineate the boundaries of core&nbsp;and buffer zones at the San Juan Bautista Parish Church in</div>\r\n<div style="text-align: justify;">Jimenez, Misamis Occidental on 15-20 January 2014.</div>\r\n', '\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="images/NewsScoop/2014jan02a/pic1_No002a.jpg" alt="pic1 No002a" width="300" height="203" /></p>\n<p style="text-align: center;">GNSS observation at the Parish church of San Juan Bautista</p>\n<div style="text-align: justify;">&nbsp; &nbsp; The Buffer and Core Zone Delimitation and Cartographic&nbsp;Information of Baroque Churches of the Philippines project is a&nbsp;collaborative project between NAMRIA and the National&nbsp;Commission for Culture and the Arts (NCAA). The NCAA&nbsp;spearheads the conservation of 26 Spanish colonial-era churches&nbsp;in the country, all of which are recognized as National Cultural&nbsp;Treasures by the National Museum in 2001. The declaration&nbsp;was made in support of the state policy to preserve and protect&nbsp;important cultural properties and safeguard their intrinsic value.&nbsp;The San Juan Bautista Parish Church was one of the churches&nbsp;chosen for conservation which were found to possess outstanding&nbsp;historical, cultural, artistic, and/or scientific value and are&nbsp;representative of the original church-building orders of the&nbsp;Augustinians, Franciscans, Jesuits, Dominicans, and Augustinians</div>\n<div style="text-align: justify;">Recollects.</div>\n<div style="text-align: justify;">&nbsp;</div>\n<div style="text-align: justify;">&nbsp; &nbsp; &nbsp;The MGB survey team used the GNSS survey to determine&nbsp;the coordinates of the selected core and buffer zones which&nbsp;will be used in the preparation of land use map of the selected&nbsp;National Culture Treasures. The limits of the survey include&nbsp;pre-selection of 4th-order geodetic control points (GCPs) which&nbsp;served as refence points for the GNSS observation; selection&nbsp;of core and buffer points and inclusion of old Spanish road,&nbsp;heritage houses and other structures by the local government&nbsp;units; and groupings of core, buffer points and reference points&nbsp;to create a design that will determine the development of the&nbsp;GNSS observation.</div>\n<div style="text-align: justify;">\n<p><br />&nbsp; &nbsp; &nbsp;The geodetic survey team was led by Engr. Denicia B.&nbsp;Rivera, with the following as members: Ms. Liberty L. Caluya;&nbsp;Engrs. Aila Leana T. Sampana, Ma. Almalyn B. Balladares,&nbsp;Rizalino G. Panganiban, Donnie T. Mancera, Erwin M. Gofredo,&nbsp;and Ferdinand F. Fernandez along with Ms. Ramina Z. Dela&nbsp;Cruz, Ms. Lailah B. Gealone, Ms. Joana Marie T. Panes, and&nbsp;Ms. Vanessa T. Alcala.</p>\n</div>\n<div style="text-align: center;"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/NewsScoop/2014jan02a/pic2_No002a.jpg" alt="pic2 No002a" width="500" height="254" />NAMRIA survey teams with Jimenez Municipal Mayor Rosalina K. Balais, Vice Mayor Joselito C. Chiong (sixth and fifth from left respectively) and&nbsp;\n<p style="text-align: center; display: inline !important;">Municipal Tourism&nbsp;Officer Mr. Bong Abelidas (extreme right)</p>\n</div>\n<div style="text-align: center;">&nbsp;</div>\n<div style="text-align: left;"><img src="images/NewsScoop/2014jan02a/pic3.1_No002a.jpg" alt="pic3.1 No002a" width="150" height="105" /><img src="images/NewsScoop/2014jan02a/pic3.2_No002a.jpg" alt="pic3.2 No002a" width="147" height="105" /><img src="images/NewsScoop/2014jan02a/pic3.3_No002a.jpg" alt="pic3.3 No002a" width="94" height="105" /></div>\n<div style="text-align: left;"><img src="images/NewsScoop/2014jan02a/pic4.1_No002a.jpg" alt="pic4.1 No002a" width="200" height="117" /><img src="images/NewsScoop/2014jan02a/pic4.2_No002a.jpg" alt="pic4.2 No002a" width="200" height="113" /></div>\n<div style="text-align: left;"><img src="images/NewsScoop/2014jan02a/pic5.1_No002a.jpg" alt="pic5.1 No002a" width="200" height="117" /><img src="images/NewsScoop/2014jan02a/pic5.2_No002a.jpg" alt="pic5.2 No002a" width="200" height="120" /></div>\n<div style="text-align: left;">(1) (1st row from left to right) Courtesy call on Mayor Balais; Meeting with San Juan Bautista Parish priest Fr. Rosendo T. Cuaresma; and GNSS observation in&nbsp;\n<p style="display: inline !important;">barangay Rizal; and (2) (clockwise from left photo) GNSS observation in Barangays Nacional, Rizal, and Poblacion.</p>\n</div>\n<div style="text-align: left;">&nbsp;</div>', -2, 8, '2014-08-20 08:06:47', 817, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', 1, 6, '', '', 1, 1, '', 0, '*', ''),
(20, 109, 'NAMRIA 3rd ISO surveillance audit', 'namria-3rd-iso-surveillance-audit', '<p style="text-align: justify;">\r\n	NAMRIA successfully made it through the third surveillance audit conducted on 26 March 2014 by the Certification&nbsp;International Philippines (CIP) Inc. and is expected to receive its continuing recommendation for ISO certification&nbsp;upon satisfactory closure of pending action requests. The audit was conducted by CIP auditors Ms. Clarissa M.&nbsp;Oracion and Mr. Arnel I. Intatano for the head office and the Barko ng Republika ng Pilipinas (BRP) Hydrographer Ventura&nbsp;docked in Subic respectively. The audit covered the following areas: (1) Instrumentation and Communications Division&nbsp;(ICED), Support Services Branch; (2) Geodesy and Geophysics Division (GGD), Mapping and Geodesy Branch; (3) Geospatial<br />\r\n	Database Management Division (GDMD), Geospatial Information Systems Management Branch; (4) Internal Audit, Corrective&nbsp;Action, and Preventive Action; (5) Client Satisfaction and Client Feedback; (6) Management Review, Validation of Scope of&nbsp;Certification and use of CI logo; and (8) BRP Hydrographer Ventura, Hydrography Branch.</p>\r\n<p style="text-align: justify;">\r\n	&nbsp;<img alt="pic1 No17" height="173" src="images/NewsScoop/2014aprNo17/pic1_No17.jpg" width="500" />Management Review Audit with NAMRIA Administrator Peter N. Tiangco (center), (from left) GISMB Director John SF. Fabic and Deputy Administrators&nbsp;Efren P. Carandang and Jose C. Cabanayan Jr., and Ms. Clarissa M. Oracion (right)</p>\r\n<p style="text-align: justify;">\r\n	At the closing meeting, Ms. Oracion reported that the audit plan for the agency was completely covered and the level&nbsp;of compliance with the requirements of the standard was generally satisfactory. However, she reported three minor&nbsp;non-conformities namely, two for BRP Hydrographer Ventura for its functional objectives related to maintenance, and&nbsp;calibration plan specifically in monitoring maintenance schedule; and one for the lapses seen on ICED’s failure to show&nbsp;records on the monitoring and measurement for the repair of technical equipment, lack of effective system of monitoring&nbsp;inventory/status of equipment, and no record to show evidence of the effective implementation of the equipment preventive<br />\r\n	maintenance schedule.Some opportunities for improvement were also identified. Among them were the following: (1)&nbsp;Review and clarify what functional objective ICED would adopt; monitor and record problems on requests for repair and&nbsp;facilitate retrieval of records; (2) Reflect changes made in the 2014 project profile form and digitally back up for permanent<br />\r\n	records of GGD; (3) Facilitate retrieval of records to show evidence of coordination with agencies and the number of&nbsp;digitized tiles for GDMD; and (4) Conduct internal audit for management responsibility function.</p>\r\n<p>\r\n	Ms. Oracion also reported that corrections and corrective&nbsp;actions should be verified if they were actually implemented&nbsp;and if the correction plan was effective owing to nonrecurrence<br />\r\n	of the root cause. She cited the good client&nbsp;perception result with 97.39% client satisfaction attained as&nbsp;against the 85% target but also the need to review for the&nbsp;reconciliation of the target with its data source. The&nbsp;Management was cited for its minutes of the Management<br />\r\n	review meeting but there was a recommendation to include&nbsp;the results about the discussed action plans and&nbsp;recommendations.</p>\r\n<p>\r\n	<br />\r\n	Administrator Peter N. Tiangco expressed the agency’s&nbsp;elation over the generally favorable audit result. The&nbsp;observations and suggestions, according to him, can be easily&nbsp;addressed and are for the overall improvement of the agency’s&nbsp;service to its clients and to the nation. The Administrator ended&nbsp;the meeting by expressing his gratitude to the CIP.</p>\r\n<p>\r\n	<img alt="pic2 No17" height="181" src="images/NewsScoop/2014aprNo17/pic2_No17.jpg" width="300" /><br />\r\n	Audit for the Client Needs and Client feedback</p>\r\n', '', 1, 8, '2014-08-20 08:25:27', 817, '', '2014-10-02 02:15:18', 816, 0, '0000-00-00 00:00:00', '2014-08-20 08:50:52', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 5, '', '', 1, 28, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(21, 110, 'Agencies convene for two-phase Manila Bay undertaking', 'agencies-convene-for-two-phase-manila-bay-undertaking', '<p>\n	NAMRIA hosted the planning workshop on the updating&nbsp;of the Manila Bay Environmental Atlas (MBEA) and&nbsp;preparatory activities for the Bathymetric Survey Project at&nbsp;the NAMRIA main office in Taguig City on 25 April 2014.</p>\n<p>\n	&nbsp;The following agencies participated in the event: (1)&nbsp;DENR Offices and attached bureaus/agencies (i.e., DENRNCR,&nbsp;Regions 3 and 4A, Environmental Management Bureau,&nbsp;NAMRIA, Laguna Lake Development Authority, Mines and&nbsp;Geosciences Bureau [MGB], Manila Bay Coordinating Office&nbsp;[MBCO], and Biodiversity Management Bureau [the former&nbsp;Protected Areas and Wildlife Bureau]; (2) Department of&nbsp;Interior and Local Government; (3) Department of Science&nbsp;and Technology-Philippine Atmospheric, Geophysical and&nbsp;Astronomical Services Administration; (4) Department of&nbsp;Public Works and Highways-Central Office and Planning&nbsp;Service; (5) National Housing Authority; (6) Housing and&nbsp;Land Use Regulatory Board; (7) National Water Resource&nbsp;Board; (8) National Solid Waste Management Commission&nbsp;Secretariat; (9) Philippine Coast Guard-National Capital&nbsp;Region; (10) Philippine Information Agency; (11) Philippine&nbsp;Ports Authority; (12) Philippine Statistics Authority;&nbsp;(13) Provincial Government – Environment and Natural&nbsp;Resources Office (PG-ENRO) (i.e., Cavite, Laguna, Nueva&nbsp;Ecija, Pampanga, Rizal and Tarlac), and (14) Pasig River&nbsp;Rehabilitation Commission.</p>\n<p>\n	<img alt="pic1No24" height="263" src="images/NewsScoop/2014aprNo24/pic1No24.jpg" width="500" /><br />\n	Dir. Noel Gaerlan of MBCO briefly discusses the undertakings</p>\n<p>\n	In his opening remarks, MBCO Executive/Program&nbsp;Director Noel Antonio V. Gaerlan gave a brief background&nbsp;of his office and discussed the expected outputs of the&nbsp;project. He said that the project aims to update the MBEA&nbsp;and uploading the same to the Philippine Geoportal system. It is also expected to generate a plan for the bathymetric&nbsp;survey of Manila Bay.</p>\n<p>\n	<img alt="pic2 No24" height="205" src="images/NewsScoop/2014aprNo24/pic2_No24.jpg" width="500" /></p>\n<p>\n	<img alt="pic3 No24" height="205" src="images/NewsScoop/2014aprNo24/pic3_No24.jpg" width="500" /><br />\n	(Top photo) Mr. Eric Brillantes of GDMD-GISMB discusses the list of objectives of the planning JN HUNT&nbsp;workshop; (Bottom photo) Participants of the planning workshop.</p>\n<p>\n	&nbsp; &nbsp; &nbsp;The workshop objectives were presented by Mr.&nbsp;Eriberto N. Brillantes, Information Technology Officer II&nbsp;of the Geospatial Database Management Division under&nbsp;the Geospatial Information Systems Management Branch&nbsp;(GDMD-GISMB), to include: (1) Finalization of the work&nbsp;plan; (2) Assessment on the current data holdings; (3) Roles&nbsp;of member agencies; (4) Presentation of bathymetry data&nbsp;covering the whole Manila Bay; (5) Plans and strategies for&nbsp;data assessment; (6) Listing of new data needed to update&nbsp;the atlas; and (7) Outputs on the final work plan.</p>\n<p>\n	&nbsp; &nbsp; &nbsp;GDMD-GISMB Chief Benjamin P. Balais discussed the&nbsp;attributes of the original MBEA. He also presented different&nbsp;ways of updating the atlas.<br />\n	<br />\n	&nbsp; &nbsp; &nbsp;Ltjg. Jonathan L. Pason of the NAMRIA-Hydrography&nbsp;Branch (HB) presented the following: (a) Existing data sets&nbsp;of Manila Bay; (b) Preparatory activities such as coordination,&nbsp;field reconnaissance, equipment calibration, and personnel&nbsp;mobilization; and (c) Data acquisition and estimates covering&nbsp;the total area of 1,668 square kilometers to be surveyed&nbsp;in 259 days, including the post-data processing using the&nbsp;state-of-the-art NAMRIA survey vessels.<br />\n	<br />\n	&nbsp; &nbsp; &nbsp;PG-ENRO head Engr. Art Punsalan suggested that&nbsp;field verification, adjustments, and necessary corrections&nbsp;on the data should be done. Mr. Danny Octaviano of the&nbsp;MGB informed the participants that there is already existing&nbsp;data from research covering the whole of Manila Bay that&nbsp;was done by the Japan International Cooperation Agency.&nbsp;Ltjg. Rommel C. Correa of the NAMRIA-HB suggested the&nbsp;inclusion of the writers/GIS experts who were previously&nbsp;involved in the creation of the atlas in 2007.</p>\n<p>\n	&nbsp; &nbsp; &nbsp;The queries for the open forum were well answered&nbsp;and noted by the NAMRIA Techinical Working Group (TWG).&nbsp;The TWG is chaired by GISMB Assistant Director Febrina E.&nbsp;Damaso.<br />\n	<br />\n	&nbsp; &nbsp; &nbsp;In the workshop proper, the participants were divided&nbsp;into three clusters: Cluster A - DENR and its attached&nbsp;agencies and bureaus, Cluster B - LGUs, and Cluster C -&nbsp;other member agencies. Cluster outputs, suggestions, and&nbsp;recommendations were presented by their respective leaders.&nbsp;Among these were standardization of all data collection&nbsp;procedures, follow-up meeting; and a permanent TWG&nbsp;composed of both principal and alternate representatives&nbsp;from the participating agencies.</p>\n', '', 1, 8, '2014-08-20 08:46:18', 817, '', '2014-10-02 02:14:48', 816, 0, '0000-00-00 00:00:00', '2014-08-20 08:49:54', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 4, '', '', 1, 9, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', ''),
(22, 111, 'NAMRIA draws PH-Indonesia EEZ Boundary Map', 'namria-draws-ph-indonesia-eez-boundary-map', '<div>&nbsp; &nbsp; &nbsp;The recent signing of the new maritime boundary agreement&nbsp;between the Philippines and Indonesia is another significant&nbsp;achievement for NAMRIA. The agency was part of the 20-year&nbsp;negotiations that led to the signing of the agreement which defines&nbsp;the limits of the two countries’ Exclusive Economic Zones (EEZs) in&nbsp;the Celebes Sea and southern Philippine Sea.</div>\n', '\r\n<div style="text-align: justify;"><img src="images/NewsScoop/2014mayNo34/pic1No34.jpg" alt="pic1No34" width="400" height="358" /></div>\r\n<div>EEZ boundary chart of the Philippines</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp; &nbsp; &nbsp;Under the United Nations Convention on the Law of the Sea&nbsp;(UNCLOS), the EEZ is a 200-nautical-mile (370-kilometer) expanse&nbsp;of sea from the baselines where a country has the exclusive rights to&nbsp;fish and exploit undersea resources such as oil, gas, and other mineral&nbsp;deposits. The negotiations were made by diplomatic and technical&nbsp;representatives of the two archipelagic states to find an equitable&nbsp;solution to their overlapping maritime areas. In the Celebes Sea, the</div>\r\n<div>\r\n<p>distance is much lesser than 400 nautical miles, hence the overlap.&nbsp;The EEZ boundary line is composed of eight turning points and has a&nbsp;total length of 627.51 nautical miles (1,162.2 kilometers). The EEZ&nbsp;boundary line, which cuts across the Celebes Sea unto the Philippine&nbsp;Sea, has varied distances from the archipelagic baselines of both&nbsp;countries, the shortest of which is 16.07 nautical miles from Sarangani&nbsp;Island of the Philippines and 15.37 nautical miles around Marore Island<br />of Indonesia.</p>\r\n<p>&nbsp; &nbsp; &nbsp;The signing of the agreement was held at Malacañang on 23 May&nbsp;2014 on the occasion of the state visit to the Philippines of Indonesian&nbsp;President Susilo Bambang Yudhoyono. President Aquino and&nbsp;President Yudhoyono witnessed the signing of the agreement by their&nbsp;respective foreign ministers, Philippine Foreign Affairs Secretary Albert&nbsp;F. del Rosario and Indonesian Foreign Affairs Minister Dr. R. M. Marty&nbsp;M. Natalegawa.&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp;One of NAMRIA’s core functions is the delimitation of the maritime&nbsp;boundaries of the Philippines. The agency was responsible for the&nbsp;establishment of the Philippine archipelagic baselines which was&nbsp;enacted into law in 2009. NAMRIA determines the different maritime&nbsp;zones, delineating them in accordance with domestic laws and the&nbsp;UNCLOS and works closely with the Department of Foreign Affairs&nbsp;when it comes to maritime boundary issues. The agency also led&nbsp;the preparation and successful defense of the country’s submission&nbsp;to the United Nations for an extended continental shelf in the Benham&nbsp;Rise Region.</p>\r\n</div>\r\n<div>\r\n<p>&nbsp; &nbsp; &nbsp;NAMRIA and its Indonesian counterpart assisted the&nbsp;Philippines-Indonesia Joint Permanent Working Group on&nbsp;Maritime and Ocean Concerns (JPWG-MOC) in preparing the&nbsp;charts for the EEZ boundary. The NAMRIA representatives who&nbsp;were part of the Philippine Technical Panel on Maritime Boundary&nbsp;Delimitation were Deputy Administrator Efren P. Carandang, HB&nbsp;OIC-Assistant Director Capt. Herbert L. Catapang, and&nbsp;Geophysicist IV Dennis B. Bringas.&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp;The NAMRIA delegation took part in the fourth preparatory&nbsp;meeting held in Jakarta, Indonesia on 17 May 2014 to resolve the&nbsp;remaining issues pertaining to the draft EEZ boundary agreement&nbsp;and agree on the final design of the accompanying EEZ boundary&nbsp;chart. The boundary agreement stipulates among others that it&nbsp;shall not prejudice the rights or positions of both sides with regard&nbsp;to the delimitation of the Continental Shelf boundary. The NAMRIA&nbsp;delegation also attended the eight meeting of the JPWG-MOC&nbsp;on the following day to endorse the draft agreement for signing of&nbsp;the espective foreign ministers and certify the accompanying&nbsp;chart. Administrator Peter N. Tiangco and Hydrography Branch&nbsp;Director Capt. Jacinto M. Cablayan along with their Indonesian&nbsp;counterparts signed the EEZ boundary chart.&nbsp;The boundary agreement is the first for the Philippines, and&nbsp;possibly the first between two major archipelagic states. This&nbsp;early, it is being hailed both locally and internationally for setting&nbsp;a good example on how two neighboring states can, in a friendly&nbsp;and peaceful manner, resolve a dispute that otherwise has become&nbsp;very contentious between and among several countries in other&nbsp;parts of the region. For both sides, the agreement will not only&nbsp;provide a clear reference line for the exercise of their respective&nbsp;jurisdictions, but will also promote more cooperation in terms of&nbsp;managing and preserving the resources in the Celebes Sea and&nbsp;southern Philippine Sea.</p>\r\n<p>&nbsp; &nbsp; &nbsp;NAMRIA was present from day one of the negotiations in&nbsp;Manado in June 1994 until its conclusion in Jakarta on 18 May<br />2014. To date NAMRIA continues to provide the national&nbsp;government with the technical expertise particularly in dealing&nbsp;with maritime boundary issues to ensure that the metes and&nbsp;bounds of the national territory are always safeguarded.&nbsp;</p>\r\n<p>NAMRIA representatives, Philippine Technical Panel on&nbsp;Maritime Boundary Delimitation &amp; GISD-GISMB</p>\r\n<p><img src="images/NewsScoop/2014mayNo34/pic2No34.jpg" alt="pic2No34" width="400" height="199" /><br />President Aquino and Indonesian President Yudhoyono witness the signing&nbsp;of the charts showing the EEZs of their respective countries.</p>\r\n<p>&nbsp;</p>\r\n<p><img src="images/NewsScoop/2014mayNo34/pic3No34.jpg" alt="pic3No34" width="400" height="193" /></p>\r\n<p>Administrator Tiangco (at right) signs the EEZ boundary chart jointly&nbsp;produced by the Philippines and Indonesia; Beside him is Dr. Asep Karsidi&nbsp;who heads the Geospatial Information Agency of the Republic of Indonesia.</p>\r\n</div>', -2, 8, '2014-08-22 00:45:40', 817, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', 1, 3, '', '', 1, 0, '', 0, '*', ''),
(23, 112, 'GIS for Quezon City government (2nd Batch)', 'gis-for-quezon-city-government-2nd-batch', '<div>&nbsp; &nbsp; &nbsp;The NAMRIA Geomatics Training Center (NGTC) conducted a five-day offsite training on Geographic Information System (GIS)&nbsp;for the Quezon City government. As stipulated in the Memorandum of Agreement for the training, NAMRIA will train three batches of participants on Basic GIS at 40 hours per batch, with a maximum of 25 participants each.</div>\n<div>&nbsp;</div>\n<div>&nbsp; &nbsp; &nbsp;The training for the second batch was held at the Korea-Philippines (KORPHIL) Training Center within the Quezon City Polytechnic University (QCPU) compound in Quirino Highway, San Bartolome, Quezon City on 27-30 May and 03 June 2014. The training for the first batch was held in March 2014.</div>\n<div>&nbsp;</div>\n<div>&nbsp; &nbsp; &nbsp;The participants were from different offices such as the following: City General Service Development Department; Engineering Department; Environmental Protection and Waste Management Department; Gender and Development Resource andCoordinating office; Housing Community Development and Resettlement Department;\n<p>KORPHIL Training Center; Market Development and&nbsp;Administration Department; Public Order and Safety&nbsp;Department; QCPU; QC Division of City Schools; and&nbsp;Sikap-Buhay Entrepreneur and Cooperative Office.&nbsp;The NGTC training team was composed of Mr.&nbsp;Alvin F. Laurio as resource speaker with Mr. Limuel C.&nbsp;Sagun and this writer as training assistants. The NGTC&nbsp;is under the Geospatial Information Services Division&nbsp;of the NAMRIA Geospatial Information Systems&nbsp;Management Branch.&nbsp;The training for the last batch is tentatively in&nbsp;July 2014.</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n</div>', '', 0, 8, '2014-08-22 01:11:07', 817, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', 1, 2, '', '', 1, 0, '', 0, '*', ''),
