(11, 4, 1, '', '2014-07-23 02:59:59', 816, 22037, 'c1037d432df9cef3bc711bd6d54106ef3fdca53e', '{"id":4,"asset_id":"63","title":" The Philippine Transparency Seal","alias":"transparency-seal","introtext":"<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">&nbsp;<\\/p>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">&nbsp;<\\/p>\\r\\n<p><img style=\\"font-family: Verdana; font-size: 11px; line-height: 18px;\\" src=\\"http:\\/\\/namria.gov.ph\\/Images\\/transparency_seal.png\\" alt=\\"\\" width=\\"152\\" height=\\"151\\" align=\\"left\\" hspace=\\"5\\" vspace=\\"5\\" \\/><\\/p>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">A pearl buried inside a tightly-shut shell is practically worthless. Government information is a pearl, meant to be shared with the public in order to maximize its inherent value.<\\/p>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">The Transparency Seal, depicted by a pearl shining out of an open shell, is a symbol of a policy shift towards openness in access to government information. On the one hand, it hopes to inspire Filipinos in the civil service to be more open to citizen engagement; on the other, to invite the Filipino citizenry to exercise their right to participate in governance.<\\/p>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">This initiative is envisioned as a step in the right direction towards solidifying the position of the Philippines as the Pearl of the Orient \\u2013 a shining example for democratic virtue in the region.<\\/p>\\r\\n<table style=\\"font-family: Verdana; font-size: 11px; line-height: normal; width: 435px;\\" border=\\"0\\">\\r\\n<tbody>\\r\\n<tr>\\r\\n<td height=\\"30px\\">I.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#mandate\\">MANDATE, FUNCTIONS AND OFFICIALS<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">II.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#annual\\">ANNUAL REPORTS FOR THE LAST 3 YEARS<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">III.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#approved\\">APPROVED BUDGET AND CORRESPONDING TARGETS<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">IV.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#major\\">PROGRAMS AND PROJECTS - KEY RESULT AREAS<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">V.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#program\\">PROGRAM\\/PROJECT BENEFICIARIES<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">VI.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#status\\">STATUS OF IMPLEMENTATION AND PROGRAM\\/PROJECT REPORTS<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">VII.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#procurement\\">ANNUAL PROCUREMENT PLAN AND CONTRACTS AWARDED<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">VIII.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#contracts\\">CONTRACTS AWARDED<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<tr>\\r\\n<td height=\\"30px\\">IX.<\\/td>\\r\\n<td>\\r\\n<div align=\\"left\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/transparencySeal.aspx#compliance\\">CERTIFICATE OF COMPLIANCE<\\/a><\\/div>\\r\\n<\\/td>\\r\\n<\\/tr>\\r\\n<\\/tbody>\\r\\n<\\/table>\\r\\n<p><br style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\" \\/><br style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\" \\/><br style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\" \\/><\\/p>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">NAMRIA Compliance with Sec. 93 (Transparency Seal) R.A. No. 10155&nbsp;<br \\/>(General Appropriations Act FY 2012)<\\/p>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"mandate\\"><\\/a>I. Mandate, Functions and Officials<\\/p>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">The agency''s mandate and functions, names of its officials with their position and designation and contact information.<\\/p>\\r\\n<ul style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\">\\r\\n<ul>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/missionvision.pdf\\">Mandate, Mission and Vision<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/www.namria.gov.ph\\/about.aspx#functions\\">Core Functions<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/orgChartHiRes1.pdf\\">Organizational Structure<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/directory.aspx\\">Directory<\\/a><\\/li>\\r\\n<\\/ul>\\r\\n<\\/ul>\\r\\n<p>&nbsp;<\\/p>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"annual\\"><\\/a>II. Annual Reports<\\/p>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">Annual Reports, as required under National Budget Circular Nos. 507 and 507- Dated January 31, 2010 and June 12, 2007, respectively.<\\/p>\\r\\n<ul style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\"><ol>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><strong>Statement of Allotment, Obligation and Balances<\\/strong>&nbsp;<br \\/>1.0&nbsp;FY 2014<br \\/>1.1&nbsp;<a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/saob\\/saob2013.pdf\\">FY 2013<\\/a><br \\/><ol><ol>1.1.1<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/saob\\/saob2013novA.pdf\\">&nbsp;as of November ANNEX A<\\/a><br \\/><ol><ol>1.1.2<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/saob\\/saob2013novA1.pdf\\">&nbsp;as of November ANNEX A1<\\/a><br \\/><ol><ol>1.1.3<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/saob\\/saob2013_junsaro.pdf\\">&nbsp;List of ABM\\/SAROs\\/Sub-Allotment Release Orders&nbsp;<\\/a><br \\/><ol><ol>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;(as of 30 June 2013)&nbsp;<\\/ol><\\/ol><br \\/><ol><ol>1.1.4<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/saob\\/saob2013_jundbal.pdf\\">&nbsp;Statement of Appropriations, Allotments, Obligations, &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Disbursementsand Balances (as of 30 June 2013)<\\/a>1.2&nbsp;<a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/saob\\/saob2012.pdf\\">FY 2012<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><strong>Disbursement and Income<\\/strong>&nbsp;<br \\/>2.1 Disbursement Report<ol><ol>2.1.0<\\/ol><\\/ol><a style=\\"color: #0066cc;\\">&nbsp;FY 2014<\\/a><br \\/><ol><ol>2.1.1<\\/ol><\\/ol><a style=\\"color: #0066cc;\\">&nbsp;FY 2013<\\/a><br \\/><ol><ol><ol>2.1.1.1<\\/ol><\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/dr\\/dr2013novAb.pdf\\">&nbsp;as of November ANNEX B<\\/a><br \\/><ol><ol><ol>2.1.2.2<\\/ol><\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/dr\\/dr2013novAc.pdf\\">&nbsp;as of November ANNEX C<\\/a><br \\/><ol><ol><ol>2.1.3.3<\\/ol><\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/dr\\/dr2013novAd.pdf\\">&nbsp;as of November ANNEX D<\\/a><br \\/><ol><ol><ol>2.1.4.4<\\/ol><\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/dr\\/dr2013jun_dscoub.pdf\\">&nbsp;Detailed Statement of Current Year''s Obligations,&nbsp;<br \\/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Unpaid Obligations(as of 30 June 2013)&nbsp;<\\/a><br \\/><ol><ol><ol>2.1.4.5<\\/ol><\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/dr\\/dr2013jun_spoupo.pdf\\">&nbsp;Summary of Prior Year''s Obligations and&nbsp;<br \\/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Unpaid Prior Year''s Obligations(as of 30 June 2013)<\\/a><br \\/><ol><ol><ol>2.1.4.6<\\/ol><\\/ol><\\/ol>