\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/gaa\\/gaa2014.pdf\\">FY 2014<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/gaa\\/gaa2013.pdf\\">FY 2013<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/gaa\\/gaa2012.pdf\\">FY 2012<\\/a><\\/li>\\r\\n<\\/ol><\\/ul>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">\\u00a0 \\u00a0 \\u00a0 \\u00a0 \\u00a0 \\u00a04. FY 2011<\\/p>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"major\\"><\\/a>IV. Program and Projects - Key Result Areas<\\/p>\\r\\n<blockquote style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\">\\r\\n<p style=\\"padding: 0px 20px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/kra\\/kra2012.pdf\\">Major programs and projects categorized in accordance with the five key result areas under E.O. 43, s. 2011<\\/a><\\/p>\\r\\n<\\/blockquote>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">\\u00a0<\\/p>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"program\\"><\\/a>V. Program\\/Projects Beneficiaries<\\/p>\\r\\n<blockquote style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\">\\r\\n<p style=\\"padding: 0px 20px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/tarben\\/2014beneficiaries.pdf\\">2014 NAMRIA''s Targets Project beneficiaries<\\/a><\\/p>\\r\\n<p style=\\"padding: 0px 20px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/2013beneficiaries.pdf\\">2013 NAMRIA''s Targets Project beneficiaries<\\/a><\\/p>\\r\\n<p style=\\"padding: 0px 20px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/2012beneficiaries.pdf\\">2012 NAMRIA''s Program or Project beneficiaries<\\/a><\\/p>\\r\\n<\\/blockquote>\\r\\n<p style=\\"padding: 0px 20px; font-family: Verdana; line-height: 18px; font-size: 11px;\\">\\u00a0<\\/p>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"status\\"><\\/a>VI. Status of Project\\/Program Implementation<\\/p>\\r\\n<ul style=\\"font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\"><ol>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\">FY 2014<br \\/><ol><ol>1.0\\u00a0<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/ppr\\/ppr_jan2014.pdf\\">January\\u00a0<\\/a><br \\/><ol><ol>1.1\\u00a0<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/ppr\\/ppr_feb2014.pdf\\">February\\u00a0<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/ppr\\/2013ppr.zip\\">FY 2013<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/pir\\/pir2012.pdf\\">FY 2012<\\/a><\\/li>\\r\\n<\\/ol><\\/ul>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"procurement\\"><\\/a>VII. Annual Procurement Plan<\\/p>\\r\\n<ul class=\\"style1\\" style=\\"color: #ffffff; font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\"><ol class=\\"style2\\" style=\\"color: #000000;\\">\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\">FY 2014<\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/app\\/app2013.pdf\\">FY 2013<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/app\\/app2012.pdf\\">FY 2012<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/app\\/app2011.pdf\\">FY 2011<\\/a><\\/li>\\r\\n<\\/ol><\\/ul>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"contracts\\"><\\/a>VIII. Contracts Awarded<\\/p>\\r\\n<ul class=\\"style1\\" style=\\"color: #ffffff; font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\"><ol class=\\"style2\\" style=\\"color: #000000;\\">\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\">FY 2014<\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/soac\\/soac2013Nov.pdf\\">FY 2013<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/soac\\/soac2012.pdf\\">FY 2012<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/soac\\/soac2011.pdf\\">FY 2011<\\/a><\\/li>\\r\\n<\\/ol><\\/ul>\\r\\n<p class=\\"sectionHeader\\" style=\\"padding: 0px 20px; font-family: Georgia; line-height: 18px; font-size: 16px; color: #ff6600;\\"><a name=\\"compliance\\"><\\/a>IX. Certificate of Compliance<\\/p>\\r\\n<ul class=\\"style1\\" style=\\"color: #ffffff; font-family: Verdana; font-size: 11px; line-height: normal; text-align: -webkit-center;\\"><ol class=\\"style2\\" style=\\"color: #000000;\\">\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\">FY 2013<\\/a><br \\/><ol><ol>1.1\\u00a0<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/coc\\/coc_saln2013.pdf\\">Statement of Assets, Liabilities, and Networth (SALN)<\\/a><br \\/><ol><ol>1.2\\u00a0<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/coc\\/coc_philgepsdec2013.pdf\\">PhilGEPS Posting<\\/a><br \\/><ol><ol>1.3\\u00a0<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/coc\\/coc_trans2013.pdf\\">Transparency Seal Provision of the General Appropriation Act of 2013<\\/a><br \\/><ol><ol>1.4\\u00a0<\\/ol><\\/ol><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/coc\\/coc_ARTA.pdf\\">Anti-Red Tape Act<\\/a><\\/li>\\r\\n<li style=\\"padding: 0px 20px 10px 0px; text-align: left; line-height: 18px;\\"><a style=\\"color: #0066cc;\\" href=\\"http:\\/\\/namria.gov.ph\\/Downloads\\/Transparency\\/coc\\/coc2012.pdf\\">FY 2012<\\/a><\\/li>\\r\\n<\\/ol><\\/ul>","fulltext":"","state":"1","catid":"10","created":"2014-07-21 07:47:45","created_by":"817","created_by_alias":"","modified":"2014-07-31 07:20:40","modified_by":"817","checked_out":"817","checked_out_time":"2014-07-31 07:07:34","publish_up":"2014-07-22 01:13:36","publish_down":"0000-00-00 00:00:00","images":"{\\"image_intro\\":\\"\\",\\"float_intro\\":\\"\\",\\"image_intro_alt\\":\\"\\",\\"image_intro_caption\\":\\"\\",\\"image_fulltext\\":\\"\\",\\"float_fulltext\\":\\"\\",\\"image_fulltext_alt\\":\\"\\",\\"image_fulltext_caption\\":\\"\\"}","urls":"{\\"urla\\":false,\\"urlatext\\":\\"\\",\\"targeta\\":\\"\\",\\"urlb\\":false,\\"urlbtext\\":\\"\\",\\"targetb\\":\\"\\",\\"urlc\\":false,\\"urlctext\\":\\"\\",\\"targetc\\":\\"\\"}","attribs":"{\\"show_title\\":\\"\\",\\"link_titles\\":\\"\\",\\"show_intro\\":\\"\\",\\"show_category\\":\\"\\",\\"link_category\\":\\"\\",\\"show_parent_category\\":\\"\\",\\"link_parent_category\\":\\"\\",\\"show_author\\":\\"\\",\\"link_author\\":\\"\\",\\"show_create_date\\":\\"\\",\\"show_modify_date\\":\\"\\",\\"show_publish_date\\":\\"\\",\\"show_item_navigation\\":\\"\\",\\"show_icons\\":\\"\\",\\"show_print_icon\\":\\"\\",\\"show_email_icon\\":\\"\\",\\"show_vote\\":\\"\\",\\"show_hits\\":\\"\\",\\"show_noauth\\":\\"\\",\\"alternative_readmore\\":\\"\\",\\"article_layout\\":\\"\\",\\"show_publishing_options\\":\\"\\",\\"show_article_options\\":\\"0\\",\\"show_urls_images_backend\\":\\"\\",\\"show_urls_images_frontend\\":\\"\\"}","version":9,"ordering":"0","metakey":"","metadesc":"","access":"1","hits":"61","metadata":"","featured":"0","language":"*","xreference":""}', 0),
(24, 15, 1, '', '2014-08-01 02:01:32', 818, 13436, '9ee7bda2d5350280616a8c87820393062a290047', '{"id":15,"asset_id":78,"title":"MyPhone Infinity Lite Unboxing","alias":"myphone-infinity-lite-unboxing","introtext":"<h3 style=\\"margin: 10px 0px; font-family: ''Roboto Condensed'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: normal; color: #333333; text-rendering: optimizelegibility; font-size: 24.5px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-02.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32366\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-02.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"1280\\" \\/><\\/a><\\/h3>\\r\\n<h3 style=\\"margin: 10px 0px; font-family: ''Roboto Condensed'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: normal; color: #333333; text-rendering: optimizelegibility; font-size: 24.5px;\\">We unbox MyPhone\\u2019s Infinity Lite!<\\/h3>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Over the weekend we attended MyPhone\\u2019s official launch of the Rio Craze and the Infinity over at Market! Market!, and saw the Infinity Lite in the flesh. Unfortunately the lighting at the venue did not cooperate and we didn\\u2019t get any good photos of the device. That\\u2019s not a problem now, since MyPhone has sent over their latest octa-core smartphone to the HQ and today we\\u2019re unboxing it for you guys!<\\/p>\\r\\n<h3 style=\\"margin: 10px 0px; font-family: ''Roboto Condensed'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: normal; color: #333333; text-rendering: optimizelegibility; font-size: 24.5px;\\">MyPhone Infinity Lite specs<\\/h3>\\r\\n<ul style=\\"padding: 0px; margin: 0px 0px 1em 1em; list-style-position: inside; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">\\r\\n<li style=\\"line-height: 20px;\\">1.4GHz octa-core processor<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">1GB of RAM<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">4.7-inch HD IPS display, 1280 x 720 resolution<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">8GB of storage, expandable via microSD up to 32GB<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">8-megapixel rear camera<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">5-megapixel front camera<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">WiFi, Bluetooth<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">Dual SIM<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">3G<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">2000mAh battery<\\/li>\\r\\n<li style=\\"line-height: 20px;\\">Android 4.4 KitKat<\\/li>\\r\\n<\\/ul>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-01.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32369\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-01.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"1371\\" \\/><\\/a><\\/p>\\r\\n<h3 style=\\"margin: 10px 0px; font-family: ''Roboto Condensed'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: normal; color: #333333; text-rendering: optimizelegibility; font-size: 24.5px;\\">Packaging and contents<\\/h3>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">MyPhone has continually tried to improve the look of the packaging on their smartphones, especially for their higher end models and the Infinity is no exception.\\u00a0<a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/gadget\\/myphone-agua-infinity-unboxing-and-initial-review-octa-core-for-php12999\\/\\">While the box is simpler than the one that the Infinity shipped in<\\/a>, the overall presentation and packaging is a step above other brands.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-12.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32370\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-12.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Inside the box you\\u2019ll find the typical smartphone accessories (no freebies here, we\\u2019re afraid), which includes a USB cable, charger, headphones a quick start guide and warranty information. You\\u2019ll want to pay extra attention to the quick-start guide if you want to use the Nano-SIM slot in the Infinity Lite (more on this later).<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-031.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32371\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-031.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"1280\\" \\/><\\/a><\\/p>\\r\\n<h3 style=\\"margin: 10px 0px; font-family: ''Roboto Condensed'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: normal; color: #333333; text-rendering: optimizelegibility; font-size: 24.5px;\\">Initial impressions: It\\u2019s smaller and more affordable, but it still looks premium<\\/h3>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Remember when we called the MyPhone Infinity a cross between an iPhone and a Sony Xperia Z? Well, the Infinity Lite continues the trend, \\u00a0but this time, there\\u2019s absolutely no doubts \\u2013 it definitely looks like an iPhone. The Infinity Lite seems to sport a glass back from the way it accumulated smudge marks from a few seconds of handling. A mettalic band surrounds the sides of the Infinity Lite, which adds to the whole iPhone feel.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-05.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32372\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-05.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">The right side of the device holds the power button and the volume rocker, as well as the nano-SIM slot that doubles as a microSD slot. The left side holds the slot for the micro-SIM.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-07.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32373\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-07.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Both SIM slots pop out using a small pin (that MyPhone didn\\u2019t provide with the phone) ala iPhone. Continuing on the tour of the physical ports, the 3.5mm jack is located on the top, while the USB port lies on the bottom.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-11.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32374\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-11.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Okay, remember when we said that the right side nano-SIM slot also doubled as a microSD slot? That\\u2019s not a typo \\u2013 you can use the slot for either your SIM or a microSD card, unfortunately you can\\u2019t use them both at the same time. Yes, if you want expandable memory you\\u2019ll have to sacrifice a SIM slot and vice versa, but since the internal storage of the Infinity Lite is a bit lacking (at just 8GB) most users would probably opt for expandable storage instead.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-08.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32375\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-08.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"1302\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">\\u00a0<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Many are curious about the Infinity Lite\\u2019s performance, especially since this is one of the few phones that sport an octa-core processor running at a slower 1.4GHz clockspeed. Most octa-core offerings from local brands, including MyPhone\\u2019s own Infinity run at a higher clockspeed, at around 1.7GHz. As far AnTuTu benchmark shows, the slower clockspeed of the Infinity Lite gives the device around 23857 points, around 3,000 points behind the faster Infinity.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-04.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32376\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-04.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">At Php 7,999 it\\u2019s one of the most affordable octa-cores in the land today, as well as one of the prettiest. We\\u2019ll be putting the Infinity Lite through its paces in the coming days so keep checking the site for updates.<\\/p>","fulltext":"","state":"1","catid":"8","created":"2014-08-01 02:01:32","created_by":"818","created_by_alias":"","modified":null,"modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":"2014-08-01 02:01:32","publish_down":"0000-00-00 00:00:00","images":null,"urls":null,"attribs":null,"version":1,"ordering":null,"metakey":"","metadesc":"","access":"1","hits":null,"metadata":null,"featured":"1","language":"*","xreference":null}', 0),
(25, 16, 1, '', '2014-08-01 02:05:47', 817, 6076, 'fe9d054294dea4cd326fdb0d0c114a3ac3e6e123', '{"id":16,"asset_id":79,"title":"Sony Officially Launches RX100 III Camera","alias":"sony-officially-launches-rx100-iii-camera","introtext":"<h3 style=\\"margin: 10px 0px; font-family: ''Roboto Condensed'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: normal; color: #333333; text-rendering: optimizelegibility; font-size: 24.5px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3645.jpg\\" rel=\\"lightbox[32383]\\"><img class=\\"alignnone size-full wp-image-32385\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3645.jpg\\" alt=\\"SAM_3645\\" width=\\"1280\\" height=\\"720\\" \\/><\\/a><\\/h3>\\r\\n<h3 style=\\"margin: 10px 0px; font-family: ''Roboto Condensed'', ''Helvetica Neue'', Helvetica, Arial, sans-serif; line-height: normal; color: #333333; text-rendering: optimizelegibility; font-size: 24.5px;\\">Meet the new RX100 III!<\\/h3>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Sony Philippines has officially unveiled to the local market the RX100 III. While its size puts it squarely in the point-and-shoot category, its probably not fair to call the RX100 III (and really, the entire RX100 series) just a point-and-shoot \\u2013 it has a lot of added functionality that makes it worth buying even in this\\u00a0<a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/gadget\\/point-and-shoots-are-dead-they-just-dont-know-it-yet\\/\\">post point-and-shoot world.<\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3651.jpg\\" rel=\\"lightbox[32383]\\"><img class=\\"alignnone size-full wp-image-32386\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3651.jpg\\" alt=\\"SAM_3651\\" width=\\"1280\\" height=\\"720\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">First off, the RX100 III uses a Zeiss Vario-Sonnar T 24-70mm F1.8-2.8 lens that gives you more bokeh and better low light performance when you need it. That\\u2019s paired with a 1-inch, 20.1-megapixel Exmor R BSI-CMOS sensor. The RX100 III has full manual control, allowing enthusiasts to tweak the camera\\u2019s settings to their heart\\u2019s content. The RX 100 III also has a 3-inch, full tilt LCD on the back.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3708.jpg\\" rel=\\"lightbox[32383]\\"><img class=\\"alignnone size-full wp-image-32387\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3708.jpg\\" alt=\\"SAM_3708\\" width=\\"1280\\" height=\\"720\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">One of the biggest features of the RX100 series is the retractable OLED electronic viewfinder that allows you to frame your photos the traditional way. It\\u2019s small, extremely useful and folds completely out of the way when you don\\u2019t need it, though the RX100 III loses the traditional hot shoe on the top that was present in the previous model (with Sony replacing it with a retractable flash instead), though most won\\u2019t mind.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3678.jpg\\" rel=\\"lightbox[32383]\\"><img class=\\"alignnone size-full wp-image-32388\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/SAM_3678.jpg\\" alt=\\"SAM_3678\\" width=\\"1280\\" height=\\"720\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">So how much will this thing cost you? Well, if you want one of the best point-and-shoots in the market today, you\\u2019ll have to pay top dollar \\u2013 the RX100 III costs a whopping 44,999. That\\u2019s easily the price of decent DSLR, though it can be argued that the RX100 III delivers roughly the same functionality of similarly priced DSLRS, although obviously without the ability to swap lenses. We\\u2019ll find out if its worth it when we get our review unit.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">\\u00a0<\\/p>","fulltext":"","state":null,"catid":"8","created":"2014-08-01 02:05:47","created_by":"817","created_by_alias":"","modified":null,"modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":null,"publish_down":null,"images":null,"urls":null,"attribs":null,"version":1,"ordering":null,"metakey":"Sony, Camera, DSLR, RX100","metadesc":"","access":"1","hits":null,"metadata":null,"featured":null,"language":"*","xreference":null}', 0);
