de holds the slot for the micro-SIM.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-07.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32373\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-07.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Both SIM slots pop out using a small pin (that MyPhone didn\\u2019t provide with the phone) ala iPhone. Continuing on the tour of the physical ports, the 3.5mm jack is located on the top, while the USB port lies on the bottom.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-11.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32374\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-11.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Okay, remember when we said that the right side nano-SIM slot also doubled as a microSD slot? That\\u2019s not a typo \\u2013 you can use the slot for either your SIM or a microSD card, unfortunately you can\\u2019t use them both at the same time. Yes, if you want expandable memory you\\u2019ll have to sacrifice a SIM slot and vice versa, but since the internal storage of the Infinity Lite is a bit lacking (at just 8GB) most users would probably opt for expandable storage instead.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-08.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32375\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-08.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"1302\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">&nbsp;<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">Many are curious about the Infinity Lite\\u2019s performance, especially since this is one of the few phones that sport an octa-core processor running at a slower 1.4GHz clockspeed. Most octa-core offerings from local brands, including MyPhone\\u2019s own Infinity run at a higher clockspeed, at around 1.7GHz. As far AnTuTu benchmark shows, the slower clockspeed of the Infinity Lite gives the device around 23857 points, around 3,000 points behind the faster Infinity.<\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\"><a style=\\"color: #ff4800; transition: all 0.2s linear; -webkit-transition: all 0.2s linear; outline: none !important;\\" href=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-04.jpg\\" rel=\\"lightbox[32365]\\"><img class=\\"alignnone size-full wp-image-32376\\" style=\\"height: auto; max-width: 100%; vertical-align: top; border: 0px; margin: 5px 20px 20px 0px;\\" src=\\"http:\\/\\/www.unbox.ph\\/wp-content\\/uploads\\/2014\\/07\\/MyPhone-Infinity-Lite-04.jpg\\" alt=\\"SAMSUNG CSC\\" width=\\"720\\" height=\\"405\\" \\/><\\/a><\\/p>\\r\\n<p style=\\"margin: 0px 0px 10px; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 13px; line-height: 21px;\\">At Php 7,999 it\\u2019s one of the most affordable octa-cores in the land today, as well as one of the prettiest. We\\u2019ll be putting the Infinity Lite through its paces in the coming days so keep checking the site for updates.<\\/p>","state":"1","catid":"8","created":"2014-08-01 02:01:32","created_by":"818","created_by_alias":"","modified":"2014-08-11 07:53:57","modified_by":"817","checked_out":"817","checked_out_time":"2014-08-11 07:53:49","publish_up":"2014-08-01 02:01:32","publish_down":"0000-00-00 00:00:00","images":"","urls":"","attribs":"","version":6,"ordering":"1","metakey":"","metadesc":"","access":"1","hits":"6","metadata":"","featured":"1","language":"*","xreference":""}', 0),
