(34, 18, 1, '', '2014-08-20 02:07:15', 817, 2264, 'c07e192afd6acde37855ddae0e5c506153d6972a', '{"id":18,"asset_id":106,"title":"Sample article","alias":"sample-article","introtext":"<div>The City of Las Pi\\u00f1as tapped the expertise of&nbsp;NAMRIA for Basic and Advanced GIS trainings&nbsp;using Quantum GIS software. The objective&nbsp;of the local government was to enhance the GIS&nbsp;System of the City of Las Pi\\u00f1as and to utilize it for&nbsp;the city\\u2019s disaster risk reduction and management&nbsp;and to augment the planning, monitoring, and&nbsp;policy-making activities of the city. The training&nbsp;for the basic course was held on 25-28 March and&nbsp;08 April 2014 at the Las Pi\\u00f1as City Hall, while the&nbsp;training for the advanced course was held on 14-17 July 2014 at Hotel Kimberly in Tagaytay City.&nbsp;<\\/div>\\r\\n","fulltext":"\\r\\n<div>The GIS training was organized by Mr. Julius&nbsp;Alacar of the city\\u2019s treasurer department and was&nbsp;attended by personnel from the Assessor\\u2019s Office,&nbsp;Engineering Department, Las Pi\\u00f1as Disaster Risk&nbsp;Reduction and Management Office, Office of the&nbsp;City Treasurer, and Planning Department of the&nbsp;Las Pi\\u00f1as City Hall. The resource speaker for&nbsp;both trainings was Mr. Alvin F. Laurio, the technical&nbsp;Readers can e-mail <a href=\\"mailto:mpd@namria.gov.ph\\">mpd@namria.gov.ph<\\/a> or&nbsp;fax letter to +63 2 884-2855 for their comments and Suggestions.&nbsp;GIS training for Las Pi\\u00f1as City&nbsp;Hall employees&nbsp;assistants were Mr. Dante A. Rosette Jr. and Mr.&nbsp;Marco Arkiel C. Ilagan for the&nbsp;basic GIS course,&nbsp;and Mr. Rosette and this writer for the advanced&nbsp;course. They are from the&nbsp;Geospatial Information&nbsp;Services Division of the Geospatial Information&nbsp;System Management Branch.<\\/div>\\r\\n<div>&nbsp;<\\/div>\\r\\n<div>&nbsp;<\\/div>\\r\\n<div style=\\"text-align: right;\\">&nbsp;<\\/div>","state":null,"catid":"8","created":"2014-08-20 02:07:15","created_by":"817","created_by_alias":"","modified":null,"modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":null,"publish_down":null,"images":null,"urls":null,"attribs":null,"version":1,"ordering":null,"metakey":"GIS training","metadesc":"","access":"1","hits":null,"metadata":null,"featured":null,"language":"*","xreference":null}', 0);
