(43, 19, 1, '', '2014-08-20 08:06:47', 817, 5638, 'e54866fc2bd75b7c9672b65f409d3d0c559f8261', '{"id":19,"asset_id":108,"title":"MGB survey teams conduct GNSS observation of core and buffer zones in Misamis Occidental","alias":"mgb-survey-teams-conduct-gnss-observation-of-core-and-buffer-zones-in-misamis-occidental","introtext":"<p>&nbsp;<\\/p>\\r\\n<div style=\\"text-align: justify;\\">&nbsp; &nbsp; &nbsp; Survey teams from the Geodetic Division of the Mapping&nbsp;and Geodesy Branch (MGB) conducted Global Navigation Satellite&nbsp;System (GNSS) observation to delineate the boundaries of core&nbsp;and buffer zones at the San Juan Bautista Parish Church in<\\/div>\\r\\n<div style=\\"text-align: justify;\\">Jimenez, Misamis Occidental on 15-20 January 2014.<\\/div>\\r\\n","fulltext":"\\r\\n<p><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"images\\/NewsScoop\\/2014jan02a\\/pic1_No002a.jpg\\" alt=\\"pic1 No002a\\" width=\\"300\\" height=\\"203\\" \\/><\\/p>\\r\\n<p style=\\"text-align: center;\\">GNSS observation at the Parish church of San Juan Bautista<\\/p>\\r\\n<div style=\\"text-align: justify;\\">&nbsp; &nbsp; The Buffer and Core Zone Delimitation and Cartographic&nbsp;Information of Baroque Churches of the Philippines project is a&nbsp;collaborative project between NAMRIA and the National&nbsp;Commission for Culture and the Arts (NCAA). The NCAA&nbsp;spearheads the conservation of 26 Spanish colonial-era churches&nbsp;in the country, all of which are recognized as National Cultural&nbsp;Treasures by the National Museum in 2001. The declaration&nbsp;was made in support of the state policy to preserve and protect&nbsp;important cultural properties and safeguard their intrinsic value.&nbsp;The San Juan Bautista Parish Church was one of the churches&nbsp;chosen for conservation which were found to possess outstanding&nbsp;historical, cultural, artistic, and\\/or scientific value and are&nbsp;representative of the original church-building orders of the&nbsp;Augustinians, Franciscans, Jesuits, Dominicans, and Augustinians<\\/div>\\r\\n<div style=\\"text-align: justify;\\">Recollects.<\\/div>\\r\\n<div style=\\"text-align: justify;\\">&nbsp;<\\/div>\\r\\n<div style=\\"text-align: justify;\\">&nbsp; &nbsp; &nbsp;The MGB survey team used the GNSS survey to determine&nbsp;the coordinates of the selected core and buffer zones which&nbsp;will be used in the preparation of land use map of the selected&nbsp;National Culture Treasures. The limits of the survey include&nbsp;pre-selection of 4th-order geodetic control points (GCPs) which&nbsp;served as refence points for the GNSS observation; selection&nbsp;of core and buffer points and inclusion of old Spanish road,&nbsp;heritage houses and other structures by the local government&nbsp;units; and groupings of core, buffer points and reference points&nbsp;to create a design that will determine the development of the&nbsp;GNSS observation.<\\/div>\\r\\n<div style=\\"text-align: justify;\\">\\r\\n<p><br \\/>&nbsp; &nbsp; &nbsp;The geodetic survey team was led by Engr. Denicia B.&nbsp;Rivera, with the following as members: Ms. Liberty L. Caluya;&nbsp;Engrs. Aila Leana T. Sampana, Ma. Almalyn B. Balladares,&nbsp;Rizalino G. Panganiban, Donnie T. Mancera, Erwin M. Gofredo,&nbsp;and Ferdinand F. Fernandez along with Ms. Ramina Z. Dela&nbsp;Cruz, Ms. Lailah B. Gealone, Ms. Joana Marie T. Panes, and&nbsp;Ms. Vanessa T. Alcala.<\\/p>\\r\\n<\\/div>\\r\\n<div style=\\"text-align: center;\\"><img style=\\"display: block; margin-left: auto; margin-right: auto;\\" src=\\"images\\/NewsScoop\\/2014jan02a\\/pic2_No002a.jpg\\" alt=\\"pic2 No002a\\" width=\\"500\\" height=\\"254\\" \\/>NAMRIA survey teams with Jimenez Municipal Mayor Rosalina K. Balais, Vice Mayor Joselito C. Chiong (sixth and fifth from left respectively) and&nbsp;\\r\\n<p style=\\"text-align: center; display: inline !important;\\">Municipal Tourism&nbsp;Officer Mr. Bong Abelidas (extreme right)<\\/p>\\r\\n<\\/div>\\r\\n<div style=\\"text-align: center;\\">&nbsp;<\\/div>\\r\\n<div style=\\"text-align: left;\\"><img src=\\"images\\/NewsScoop\\/2014jan02a\\/pic3.1_No002a.jpg\\" alt=\\"pic3.1 No002a\\" width=\\"150\\" height=\\"105\\" \\/><img src=\\"images\\/NewsScoop\\/2014jan02a\\/pic3.2_No002a.jpg\\" alt=\\"pic3.2 No002a\\" width=\\"147\\" height=\\"105\\" \\/><img src=\\"images\\/NewsScoop\\/2014jan02a\\/pic3.3_No002a.jpg\\" alt=\\"pic3.3 No002a\\" width=\\"94\\" height=\\"105\\" \\/><\\/div>\\r\\n<div style=\\"text-align: left;\\"><img src=\\"images\\/NewsScoop\\/2014jan02a\\/pic4.1_No002a.jpg\\" alt=\\"pic4.1 No002a\\" width=\\"200\\" height=\\"117\\" \\/><img src=\\"images\\/NewsScoop\\/2014jan02a\\/pic4.2_No002a.jpg\\" alt=\\"pic4.2 No002a\\" width=\\"200\\" height=\\"113\\" \\/><\\/div>\\r\\n<div style=\\"text-align: left;\\"><img src=\\"images\\/NewsScoop\\/2014jan02a\\/pic5.1_No002a.jpg\\" alt=\\"pic5.1 No002a\\" width=\\"200\\" height=\\"117\\" \\/><img src=\\"images\\/NewsScoop\\/2014jan02a\\/pic5.2_No002a.jpg\\" alt=\\"pic5.2 No002a\\" width=\\"200\\" height=\\"120\\" \\/><\\/div>\\r\\n<div style=\\"text-align: left;\\">(1) (1st row from left to right) Courtesy call on Mayor Balais; Meeting with San Juan Bautista Parish priest Fr. Rosendo T. Cuaresma; and GNSS observation in&nbsp;\\r\\n<p style=\\"display: inline !important;\\">barangay Rizal; and (2) (clockwise from left photo) GNSS observation in Barangays Nacional, Rizal, and Poblacion.<\\/p>\\r\\n<\\/div>\\r\\n<div style=\\"text-align: left;\\">&nbsp;<\\/div>","state":null,"catid":"8","created":"2014-08-20 08:06:47","created_by":"817","created_by_alias":"","modified":null,"modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":null,"publish_down":null,"images":null,"urls":null,"attribs":null,"version":1,"ordering":null,"metakey":"","metadesc":"","access":"1","hits":null,"metadata":null,"featured":null,"language":"*","xreference":null}', 0),
(44, 20, 1, '', '2014-08-20 08:25:27', 817, 4641, 'af5b86bb9a5e2670acca81082fb6408f3ba8cde2', '{"id":20,"asset_id":109,"title":"NAMRIA 3rd ISO surveillance audit","alias":"namria-3rd-iso-surveillance-audit","introtext":"<p style=\\"text-align: justify;\\">NAMRIA successfully made it through the third surveillance audit conducted on 26 March 2014 by the Certification&nbsp;International Philippines (CIP) Inc. and is expected to receive its continuing recommendation for ISO certification&nbsp;upon satisfactory closure of pending action requests. The audit was conducted by CIP auditors Ms. Clarissa M.&nbsp;Oracion and Mr. Arnel I. Intatano for the head office and the Barko ng Republika ng Pilipinas (BRP) Hydrographer Ventura&nbsp;docked in Subic respectively. The audit covered the following areas: (1) Instrumentation and Communications Division&nbsp;(ICED), Support Services Branch; (2) Geodesy and Geophysics Division (GGD), Mapping and Geodesy Branch; (3) Geospatial<br \\/>Database Management Division (GDMD), Geospatial Information Systems Management Branch; (4) Internal Audit, Corrective&nbsp;Action, and Preventive Action; (5) Client Satisfaction and Client Feedback; (6) Management Review, Validation of Scope of&nbsp;Certification and use of CI logo; and (8) BRP Hydrographer Ventura, Hydrography Branch.<\\/p>\\r\\n","fulltext":"\\r\\n<p style=\\"text-align: justify;\\">&nbsp;<img src=\\"images\\/NewsScoop\\/2014aprNo17\\/pic1_No17.jpg\\" alt=\\"pic1 No17\\" width=\\"500\\" height=\\"173\\" \\/>Management Review Audit with NAMRIA Administrator Peter N. Tiangco (center), (from left) GISMB Director John SF. Fabic and Deputy Administrators&nbsp;Efren P. Carandang and Jose C. Cabanayan Jr., and Ms. Clarissa M. Oracion (right)<\\/p>\\r\\n<p style=\\"text-align: justify;\\">At the closing meeting, Ms. Oracion reported that the audit plan for the agency was completely covered and the level&nbsp;of compliance with the requirements of the standard was generally satisfactory. However, she reported three minor&nbsp;non-conformities namely, two for BRP Hydrographer Ventura for its functional objectives related to maintenance, and&nbsp;calibration plan specifically in monitoring maintenance schedule; and one for the lapses seen on ICED\\u2019s failure to show&nbsp;records on the monitoring and measurement for the repair of technical equipment, lack of effective system of monitoring&nbsp;inventory\\/status of equipment, and no record to show evidence of the effective implementation of the equipment preventive<br \\/>maintenance schedule.Some opportunities for improvement were also identified. Among them were the following: (1)&nbsp;Review and clarify what functional objective ICED would adopt; monitor and record problems on requests for repair and&nbsp;facilitate retrieval of records; (2) Reflect changes made in the 2014 project profile form and digitally back up for permanent<br \\/>records of GGD; (3) Facilitate retrieval of records to show evidence of coordination with agencies and the number of&nbsp;digitized tiles for GDMD; and (4) Conduct internal audit for management responsibility function.<\\/p>\\r\\n<p>Ms. Oracion also reported that corrections and corrective&nbsp;actions should be verified if they were actually implemented&nbsp;and if the correction plan was effective owing to nonrecurrence<br \\/>of the root cause. She cited the good client&nbsp;perception result with 97.39% client satisfaction attained as&nbsp;against the 85% target but also the need to review for the&nbsp;reconciliation of the target with its data source. The&nbsp;Management was cited for its minutes of the Management<br \\/>review meeting but there was a recommendation to include&nbsp;the results about the discussed action plans and&nbsp;recommendations.<\\/p>\\r\\n<p><br \\/>Administrator Peter N. Tiangco expressed the agency\\u2019s&nbsp;elation over the generally favorable audit result. The&nbsp;observations and suggestions, according to him, can be easily&nbsp;addressed and are for the overall improvement of the agency\\u2019s&nbsp;service to its clients and to the nation. The Administrator ended&nbsp;the meeting by expressing his gratitude to the CIP.<\\/p>\\r\\n<p><img src=\\"images\\/NewsScoop\\/2014aprNo17\\/pic2_No17.jpg\\" alt=\\"pic2 No17\\" width=\\"300\\" height=\\"181\\" \\/><br \\/>Audit for the Client Needs and Client feedback<\\/p>","state":null,"catid":"8","created":"2014-08-20 08:25:27","created_by":"817","created_by_alias":"","modified":null,"modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":null,"publish_down":null,"images":null,"urls":null,"attribs":null,"version":1,"ordering":null,"metakey":"","metadesc":"","access":"1","hits":null,"metadata":null,"featured":null,"language":"*","xreference":null}', 0),
(45, 21, 1, '', '2014-08-20 08:46:18', 817, 5749, 'c8742665a2f0e6acd207e956f5e88f0c32776fbd', '{"id":21,"asset_id":110,"title":"Agencies convene for two-phase Manila Bay undertaking","alias":"agencies-convene-for-two-phase-manila-bay-undertaking","introtext":"<p>NAMRIA hosted the planning workshop on the updating&nbsp;of the Manila Bay Environmental Atlas (MBEA) and&nbsp;preparatory activities for the Bathymetric Survey Project at&nbsp;the NAMRIA main office in Taguig City on 25 April 2014.<\\/p>\\r\\n","fulltext":"\\r\\n<p>&nbsp;The following agencies participated in the event: (1)&nbsp;DENR Offices and attached bureaus\\/agencies (i.e., DENRNCR,&nbsp;Regions 3 and 4A, Environmental Management Bureau,&nbsp;NAMRIA, Laguna Lake Development Authority, Mines and&nbsp;Geosciences Bureau [MGB], Manila Bay Coordinating Office&nbsp;[MBCO], and Biodiversity Management Bureau [the former&nbsp;Protected Areas and Wildlife Bureau]; (2) Department of&nbsp;Interior and Local Government; (3) Department of Science&nbsp;and Technology-Philippine Atmospheric, Geophysical and&nbsp;Astronomical Services Administration; (4) Department of&nbsp;Public Works and Highways-Central Office and Planning&nbsp;Service; (5) National Housing Authority; (6) Housing and&nbsp;Land Use Regulatory Board; (7) National Water Resource&nbsp;Board; (8) National Solid Waste Management Commission&nbsp;Secretariat; (9) Philippine Coast Guard-National Capital&nbsp;Region; (10) Philippine Information Agency; (11) Philippine&nbsp;Ports Authority; (12) Philippine Statistics Authority;&nbsp;(13) Provincial Government \\u2013 Environment and Natural&nbsp;Resources Office (PG-ENRO) (i.e., Cavite, Laguna, Nueva&nbsp;Ecija, Pampanga, Rizal and Tarlac), and (14) Pasig River&nbsp;Rehabilitation Commission.<\\/p>\\r\\n<p><img src=\\"images\\/NewsScoop\\/2014aprNo24\\/pic1No24.jpg\\" alt=\\"pic1No24\\" width=\\"500\\" height=\\"263\\" \\/><br \\/>Dir. Noel Gaerlan of MBCO briefly discusses the undertakings<\\/p>\\r\\n<p>In his opening remarks, MBCO Executive\\/Program&nbsp;Director Noel Antonio V. Gaerlan gave a brief background&nbsp;of his office and discussed the expected outputs of the&nbsp;project. He said that the project aims to update the MBEA&nbsp;and uploading the same to the Philippine Geoportal system. It is also expected to generate a plan for the bathymetric&nbsp;survey of Manila Bay.<\\/p>\\r\\n<p><img src=\\"images\\/NewsScoop\\/2014aprNo24\\/pic2_No24.jpg\\" alt=\\"pic2 No24\\" width=\\"500\\" height=\\"205\\" \\/><\\/p>\\r\\n<p><img src=\\"images\\/NewsScoop\\/2014aprNo24\\/pic3_No24.jpg\\" alt=\\"pic3 No24\\" width=\\"500\\" height=\\"205\\" \\/><br \\/>(Top photo) Mr. Eric Brillantes of GDMD-GISMB discusses the list of objectives of the planning JN HUNT&nbsp;workshop; (Bottom photo) Participants of the planning workshop.<\\/p>\\r\\n<p>&nbsp; &nbsp; &nbsp;The workshop objectives were presented by Mr.&nbsp;Eriberto N. Brillantes, Information Technology Officer II&nbsp;of the Geospatial Database Management Division under&nbsp;the Geospatial Information Systems Management Branch&nbsp;(GDMD-GISMB), to include: (1) Finalization of the work&nbsp;plan; (2) Assessment on the current data holdings; (3) Roles&nbsp;of member agencies; (4) Presentation of bathymetry data&nbsp;covering the whole Manila Bay; (5) Plans and strategies for&nbsp;data assessment; (6) Listing of new data needed to update&nbsp;the atlas; and (7) Outputs on the final work plan.<\\/p>\\r\\n<p>&nbsp; &nbsp; &nbsp;GDMD-GISMB Chief Benjamin P. Balais discussed the&nbsp;attributes of the original MBEA. He also presented different&nbsp;ways of updating the atlas.<br \\/><br \\/>&nbsp; &nbsp; &nbsp;Ltjg. Jonathan L. Pason of the NAMRIA-Hydrography&nbsp;Branch (HB) presented the following: (a) Existing data sets&nbsp;of Manila Bay; (b) Preparatory activities such as coordination,&nbsp;field reconnaissance, equipment calibration, and personnel&nbsp;mobilization; and (c) Data acquisition and estimates covering&nbsp;the total area of 1,668 square kilometers to be surveyed&nbsp;in 259 days, including the post-data processing using the&nbsp;state-of-the-art NAMRIA survey vessels.<br \\/><br \\/>&nbsp; &nbsp; &nbsp;PG-ENRO head Engr. Art Punsalan suggested that&nbsp;field verification, adjustments, and necessary corrections&nbsp;on the data should be done. Mr. Danny Octaviano of the&nbsp;MGB informed the participants that there is already existing&nbsp;data from research covering the whole of Manila Bay that&nbsp;was done by the Japan International Cooperation Agency.&nbsp;Ltjg. Rommel C. Correa of the NAMRIA-HB suggested the&nbsp;inclusion of the writers\\/GIS experts who were previously&nbsp;involved in the creation of the atlas in 2007.<\\/p>\\r\\n<p>&nbsp; &nbsp; &nbsp;The queries for the open forum were well answered&nbsp;and noted by the NAMRIA Techinical Working Group (TWG).&nbsp;The TWG is chaired by GISMB Assistant Director Febrina E.&nbsp;Damaso.<br \\/><br \\/>&nbsp; &nbsp; &nbsp;In the workshop proper, the participants were divided&nbsp;into three clusters: Cluster A - DENR and its attached&nbsp;agencies and bureaus, Cluster B - LGUs, and Cluster C -&nbsp;other member agencies. Cluster outputs, suggestions, and&nbsp;recommendations were presented by their respective leaders.&nbsp;Among these were standardization of all data collection&nbsp;procedures, follow-up meeting; and a permanent TWG&nbsp;composed of both principal and alternate representatives&nbsp;from the participating agencies.<\\/p>","state":null,"catid":"8","created":"2014-08-20 08:46:18","created_by":"817","created_by_alias":"","modified":null,"modified_by":null,"checked_out":null,"checked_out_time":null,"publish_up":null,"publish_down":null,"images":null,"urls":null,"attribs":null,"version":1,"ordering":null,"metakey":"","metadesc":"","access":"1","hits":null,"metadata":null,"featured":null,"language":"*","xreference":null}', 0),
