bsp;the total area of 1,668 square kilometers to be surveyed&nbsp;in 259 days, including the post-data processing using the&nbsp;state-of-the-art NAMRIA survey vessels.<br \\/><br \\/>&nbsp; &nbsp; &nbsp;PG-ENRO head Engr. Art Punsalan suggested that&nbsp;field verification, adjustments, and necessary corrections&nbsp;on the data should be done. Mr. Danny Octaviano of the&nbsp;MGB informed the participants that there is already existing&nbsp;data from research covering the whole of Manila Bay that&nbsp;was done by the Japan International Cooperation Agency.&nbsp;Ltjg. Rommel C. Correa of the NAMRIA-HB suggested the&nbsp;inclusion of the writers\\/GIS experts who were previously&nbsp;involved in the creation of the atlas in 2007.<\\/p>\\r\\n<p>&nbsp; &nbsp; &nbsp;The queries for the open forum were well answered&nbsp;and noted by the NAMRIA Techinical Working Group (TWG).&nbsp;The TWG is chaired by GISMB Assistant Director Febrina E.&nbsp;Damaso.<br \\/><br \\/>&nbsp; &nbsp; &nbsp;In the workshop proper, the participants were divided&nbsp;into three clusters: Cluster A - DENR and its attached&nbsp;agencies and bureaus, Cluster B - LGUs, and Cluster C -&nbsp;other member agencies. Cluster outputs, suggestions, and&nbsp;recommendations were presented by their respective leaders.&nbsp;Among these were standardization of all data collection&nbsp;procedures, follow-up meeting; and a permanent TWG&nbsp;composed of both principal and alternate representatives&nbsp;from the participating agencies.<\\/p>","state":"1","catid":"8","created":"2014-08-20 08:46:18","created_by":"817","created_by_alias":"","modified":"2014-08-20 08:49:54","modified_by":"818","checked_out":"818","checked_out_time":"2014-08-20 08:49:43","publish_up":"2014-08-20 08:49:54","publish_down":"0000-00-00 00:00:00","images":"","urls":"","attribs":"","version":2,"ordering":"0","metakey":"","metadesc":"","access":"1","hits":"2","metadata":"","featured":"1","language":"*","xreference":""}', 0),
