owever, she reported three minor&nbsp;non-conformities namely, two for BRP Hydrographer Ventura for its functional objectives related to maintenance, and&nbsp;calibration plan specifically in monitoring maintenance schedule; and one for the lapses seen on ICED\\u2019s failure to show&nbsp;records on the monitoring and measurement for the repair of technical equipment, lack of effective system of monitoring&nbsp;inventory\\/status of equipment, and no record to show evidence of the effective implementation of the equipment preventive<br \\/>maintenance schedule.Some opportunities for improvement were also identified. Among them were the following: (1)&nbsp;Review and clarify what functional objective ICED would adopt; monitor and record problems on requests for repair and&nbsp;facilitate retrieval of records; (2) Reflect changes made in the 2014 project profile form and digitally back up for permanent<br \\/>records of GGD; (3) Facilitate retrieval of records to show evidence of coordination with agencies and the number of&nbsp;digitized tiles for GDMD; and (4) Conduct internal audit for management responsibility function.<\\/p>\\r\\n<p>Ms. Oracion also reported that corrections and corrective&nbsp;actions should be verified if they were actually implemented&nbsp;and if the correction plan was effective owing to nonrecurrence<br \\/>of the root cause. She cited the good client&nbsp;perception result with 97.39% client satisfaction attained as&nbsp;against the 85% target but also the need to review for the&nbsp;reconciliation of the target with its data source. The&nbsp;Management was cited for its minutes of the Management<br \\/>review meeting but there was a recommendation to include&nbsp;the results about the discussed action plans and&nbsp;recommendations.<\\/p>\\r\\n<p><br \\/>Administrator Peter N. Tiangco expressed the agency\\u2019s&nbsp;elation over the generally favorable audit result. The&nbsp;observations and suggestions, according to him, can be easily&nbsp;addressed and are for the overall improvement of the agency\\u2019s&nbsp;service to its clients and to the nation. The Administrator ended&nbsp;the meeting by expressing his gratitude to the CIP.<\\/p>\\r\\n<p><img src=\\"images\\/NewsScoop\\/2014aprNo17\\/pic2_No17.jpg\\" alt=\\"pic2 No17\\" width=\\"300\\" height=\\"181\\" \\/><br \\/>Audit for the Client Needs and Client feedback<\\/p>","state":"1","catid":"8","created":"2014-08-20 08:25:27","created_by":"817","created_by_alias":"","modified":"2014-08-20 08:50:52","modified_by":"818","checked_out":"818","checked_out_time":"2014-08-20 08:50:32","publish_up":"2014-08-20 08:50:52","publish_down":"0000-00-00 00:00:00","images":"","urls":"","attribs":"","version":2,"ordering":"1","metakey":"","metadesc":"","access":"1","hits":"2","metadata":"","featured":"1","language":"*","xreference":""}', 0);
